import React from 'react';
import style from './Post.module.css';
import user from '../../assets/userPhoto.jpg';
function Post() {
  const props = {
    userPhoto: 'http://www.wpkixx.com/html/winku-dark/images/resources/friend-avatar10.jpg',
    userName: 'Janice Griffith',
    postData: 'Published: June,2 2018 19:00 PM',
    description:
      "World's most beautiful car in Curabitur #test drive booking ! The most beautiful car available in america and the Saudia Arabia, you can book your test drive by our official Website.",
  };

  return (
    <div className={style.main}>
      <div className={style.username}>
        <img
          className={style.image}
          src={props.userPhoto ? props.userPhoto : user}
          alt="my image"
        />
      </div>
      <div className={style.data_post}>
        <div className={style.name}>Janice Griffith </div>
        <div className={style.data}>Published: June,2 2018 19:00 PM</div>
      </div>
      <div>
        <div className={style.description}>
          World's most beautiful car in Curabitur #test drive booking ! The most beautiful car
          available in america and the Saudia Arabia, you can book your test drive by our official
          Website.
        </div>
      </div>
      <div className={style.reaction}>
        <div className={style.like}>Like 10</div>
        <div className={style.comments}>Comments 5</div>
        <div className={style.reposts}>Reposts 7</div>
      </div>
    </div>
  );
}

export default Post;
